CREATE TABLE "public"."Album"  ( 
	"AlbumId" 	integer NOT NULL,
	"Title"   	varchar(160) NOT NULL,
	"ArtistId"	integer NOT NULL,
	PRIMARY KEY("AlbumId")
)
GO
CREATE TABLE "public"."Artist"  ( 
	"ArtistId"	integer NOT NULL,
	"Name"    	varchar(120) NULL,
	PRIMARY KEY("ArtistId")
)
GO
CREATE TABLE "public"."Customer"  ( 
	"CustomerId"  	integer NOT NULL,
	"FirstName"   	varchar(40) NOT NULL,
	"LastName"    	varchar(20) NOT NULL,
	"Company"     	varchar(80) NULL,
	"Address"     	varchar(70) NULL,
	"City"        	varchar(40) NULL,
	"State"       	varchar(40) NULL,
	"Country"     	varchar(40) NULL,
	"PostalCode"  	varchar(10) NULL,
	"Phone"       	varchar(24) NULL,
	"Fax"         	varchar(24) NULL,
	"Email"       	varchar(60) NOT NULL,
	"SupportRepId"	integer NULL,
	PRIMARY KEY("CustomerId")
)
GO
CREATE TABLE "public"."Employee"  ( 
	"EmployeeId"	integer NOT NULL,
	"LastName"  	varchar(20) NOT NULL,
	"FirstName" 	varchar(20) NOT NULL,
	"Title"     	varchar(30) NULL,
	"ReportsTo" 	integer NULL,
	"BirthDate" 	timestamp NULL,
	"HireDate"  	timestamp NULL,
	"Address"   	varchar(70) NULL,
	"City"      	varchar(40) NULL,
	"State"     	varchar(40) NULL,
	"Country"   	varchar(40) NULL,
	"PostalCode"	varchar(10) NULL,
	"Phone"     	varchar(24) NULL,
	"Fax"       	varchar(24) NULL,
	"Email"     	varchar(60) NULL,
	PRIMARY KEY("EmployeeId")
)
GO
CREATE TABLE "public"."Genre"  ( 
	"GenreId"	integer NOT NULL,
	"Name"   	varchar(120) NULL,
	PRIMARY KEY("GenreId")
)
GO
CREATE TABLE "public"."Invoice"  ( 
	"InvoiceId"        	integer NOT NULL,
	"CustomerId"       	integer NOT NULL,
	"InvoiceDate"      	timestamp NOT NULL,
	"BillingAddress"   	varchar(70) NULL,
	"BillingCity"      	varchar(40) NULL,
	"BillingState"     	varchar(40) NULL,
	"BillingCountry"   	varchar(40) NULL,
	"BillingPostalCode"	varchar(10) NULL,
	"Total"            	numeric(10,2) NOT NULL,
	PRIMARY KEY("InvoiceId")
)
GO
CREATE TABLE "public"."InvoiceLine"  ( 
	"InvoiceLineId"	integer NOT NULL,
	"InvoiceId"    	integer NOT NULL,
	"TrackId"      	integer NOT NULL,
	"UnitPrice"    	numeric(10,2) NOT NULL,
	"Quantity"     	integer NOT NULL,
	PRIMARY KEY("InvoiceLineId")
)
GO
CREATE TABLE "public"."MediaType"  ( 
	"MediaTypeId"	integer NOT NULL,
	"Name"       	varchar(120) NULL,
	PRIMARY KEY("MediaTypeId")
)
GO
CREATE TABLE "public"."Playlist"  ( 
	"PlaylistId"	integer NOT NULL,
	"Name"      	varchar(120) NULL,
	PRIMARY KEY("PlaylistId")
)
GO
CREATE TABLE "public"."PlaylistTrack"  ( 
	"PlaylistId"	integer NOT NULL,
	"TrackId"   	integer NOT NULL,
	PRIMARY KEY("PlaylistId","TrackId")
)
GO
CREATE TABLE "public"."Track"  ( 
	"TrackId"     	integer NOT NULL,
	"Name"        	varchar(200) NOT NULL,
	"AlbumId"     	integer NULL,
	"MediaTypeId" 	integer NOT NULL,
	"GenreId"     	integer NULL,
	"Composer"    	varchar(220) NULL,
	"Milliseconds"	integer NOT NULL,
	"Bytes"       	integer NULL,
	"UnitPrice"   	numeric(10,2) NOT NULL,
	PRIMARY KEY("TrackId")
)
GO
CREATE TABLE "public"."email_address"  ( 
	"email_address_id"	integer NULL,
	"email_address"   	varchar(250) NULL,
	"contactid"       	integer NULL 
	)
GO
CREATE TABLE "public"."features"  ( 
	"feature_id"      	char(10) NOT NULL,
	"feature_name"    	varchar(100) NULL,
	"sub_feature_name"	varchar(50) NULL,
	"priority"        	char(10) NULL,
	"planned_date"    	date NULL,
	"status"          	char(15) NULL,
	"comments"        	varchar(20) NULL 
	)
GO

